// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CardTrading {
    // Each playerâ€™s inventory: address => [amount of card 0-8]
    mapping(address => uint[9]) public cardInventory;

    // Simplified trade listing structure: single card for single card
    struct Listing {
        address seller;
        uint offerCardId;
        uint requestCardId;
        bool active;
    }

    Listing[] public listings;

    // Add a specific card to a user's inventory, used with the wheel function
    function addCard(address to, uint cardId) external {
        require(to != address(0), "Invalid address");
        require(cardId < 9, "Invalid card ID"); // Ensure valid card ID (0 to 8)

        cardInventory[to][cardId] += 1;
    }

    // Transfer cards from msg.sender to another user
    function transferCards(address to, uint[9] calldata cardsToSend) external {
        require(to != address(0), "Invalid recipient");

        for (uint i = 0; i < 9; i++) {
            uint amount = cardsToSend[i];
            if (amount > 0) {
                require(cardInventory[msg.sender][i] >= amount, "Not enough cards to send");
                cardInventory[msg.sender][i] -= amount;
                cardInventory[to][i] += amount;
            }
        }
    }

    // Create a listing for one card in exchange for another card
    function createListing(uint offerCardId, uint requestCardId) external {
        require(offerCardId < 9 && requestCardId < 9, "Invalid card ID");
        require(cardInventory[msg.sender][offerCardId] >= 1, "You don't have the offered card");

        listings.push(Listing({
            seller: msg.sender,
            offerCardId: offerCardId,
            requestCardId: requestCardId,
            active: true
        }));
    }

    // Accept a listing and perform the trade
    function acceptListing(uint listingId) external {
        require(listingId < listings.length, "Invalid listing ID");
        Listing storage listing = listings[listingId];
        require(listing.active, "Listing is no longer active");
        require(msg.sender != listing.seller, "Cannot accept your own listing");

        // Check buyer owns the requested card
        require(cardInventory[msg.sender][listing.requestCardId] >= 1, "You do not have the requested card");

        // Perform the trade
        cardInventory[msg.sender][listing.requestCardId] -= 1;
        cardInventory[listing.seller][listing.requestCardId] += 1;

        cardInventory[listing.seller][listing.offerCardId] -= 1;
        cardInventory[msg.sender][listing.offerCardId] += 1;

        listing.active = false;
    }

    // Get all listings
    function getAllListings() external view returns (Listing[] memory) {
        return listings;
    }
}

